def initialize(context):
    pipe = zipline.pipeline.Pipeline()  
    pipe = zipline.api.attach_pipeline(pipe, name='my_pipeline')  
    dollar_volume = zipline.pipeline.factors.AverageDollarVolume(window_length=5)  
    pipe.add(dollar_volume, 'dollar_volume')  
    high_dollar_volume = dollar_volume.top(3000)  
    pipe.set_screen(high_dollar_volume)  

    zipline.api.schedule_function(
        rebalance,
        zipline.api.date_rules.week_start(),
        zipline.api.time_rules.market_open(),
    )

def rebalance(context, data):
    day = str(zipline.api.get_datetime().date())
    want = pool[day]
    
    
    results = zipline.api.pipeline_output('my_pipeline')  
    ss = list(map(lambda x:x.symbol, results.index.tolist()))
    x = set()
    for i in range(len(ss)):
        if ss[i] in want:
            x.add(i)
    
    df = data.history(results.index[list(x)], fields="price", bar_count=200, frequency="1d").resample('1W').last().T
    df = df.dropna(axis=0)
    df.to_csv('d2.csv')
    
